description:
Verenigde Staten
Drama / Romantiek
113 minuten

een goeie film

met Robert Pattinson, Emilie de Ravin en Pierce Brosnan

Tyler Hawkins is een jongen die na de zelfmoord van zijn broer en de scheiding van zijn ouders in een staat van totale lethargie 
belandt. In schril contrast daarmee staat een jonge vrouw, Ally Craig (De Ravin), die een tragedie heeft meegemaakt maar daarna 
juist de carpe diem-filosofie omarmt. De twee krijgen wat met elkaar, maar niet al het emotionele puin is meteen geruimd.
